const int N_INDSETS = 200054;
const std::string INDSETS_FILE = "indsets.txt";

int orbit[272][17];
int indsets[N_INDSETS][16];

bool current_mask[272] = {};
bool unvisited[272] = {};

void depth_first_search(int i) {
    unvisited[i] = false;              
    for (int j = 0; j < 60; ++j) {     // for all 60 neighbors
        int nb = graph[i][j];
        if (unvisited[nb])
            depth_first_search(nb);    // search recursively
    }
}

int count_connected_components(int indset, int row) {
    for (int i = 0; i < 17; ++i) {
        if (rowspace[row][i]) {
            for (int j = 0; j < 16; ++j) {
                current_mask[orbit[ indsets[indset][j] ][i]] = true;
            }
        }
    }
    for (int i = 0; i < 272; ++i)
        unvisited[i] = current_mask[i];
    
    int cc = 0;
    for (int i = 0; i < 272; ++i) {
        if (unvisited[i]) {
            cc++;
            depth_first_search(i);
        }
    }
    return cc;
}

int main() {
    std::ifstream in(INDSETS_FILE);
    for (int i = 0; i < N_INDSETS; ++i) {
        for (int j = 0; j < 16; ++j) {
            in >> indsets[i][j];
        }
    }
    for (int i = 0; i < 272; ++i) {
        orbit[i][0] = i;
        for (int j = 1; j < 17; ++j) {
            orbit[i][j] = psi[orbit[i][j-1]];
        }
    }
    for (int i = 0; i < N_INDSETS; ++i) {
        for (int j = 0; j < 60; ++j) {
            std::fill(current_mask, current_mask + 272, 0);
            int cc = count_connected_components(i,j);
            if (cc != 1) {
                std::cout << "Found a counterexample (indset #" << i << ", row #" << j << ", cc = " << cc << ")" << std::endl;
            }
        }
        if (i % 1000 == 0) {
            std::cout << "Done indset #" << i << std::endl;
        }
    }
    std::cout << "Done." << std::endl;
}
